-- Make the Frame draggable
local dragging
local dragInput
local dragStart
local startPos

local function update(input)
	if not dragging then return end
	local delta = input.Position - dragStart
	frame.Position = UDim2.new(
		startPos.X.Scale,
		startPos.X.Offset + delta.X,
		startPos.Y.Scale,
		startPos.Y.Offset + delta.Y
	)
end

